import React from 'react';

const SkillsWindow = () => (
  <div className="bg-white dark:bg-slate-800 p-4 rounded-xl shadow-xl w-72">
    <h2 className="text-xl font-bold mb-2">⚙️ Skills</h2>
    <ul className="list-disc list-inside text-sm">
      <li>M365 Admin & Security</li>
      <li>Azure Virtual Machines & Networking</li>
      <li>Intune, Endpoint Management</li>
      <li>PowerShell, Automation</li>
      <li>Entra ID & Access Control</li>
      <li>Power Apps & Integration</li>
    </ul>
  </div>
);

export default SkillsWindow;
